def execImportPrivateDataThread( mx,path):
    threadList = []

    for root, dirs, files in os.walk(path):

        for file in files:
            filePath = os.path.join(root,file)
            threadList.append(
                Thread(target=mx.importPrivateData,args=(file,filePath,))
            )


    return threadList

